import React from 'react';
import { motion } from 'framer-motion';
import { MapPin, Link, Star, TrendingUp, FileText } from 'lucide-react';

const Services = () => {
  const services = [
    {
      icon: MapPin,
      title: 'GBP Optimization',
      description: 'Complete Google Business Profile setup and optimization for maximum local visibility',
      features: ['Profile completion', 'Category optimization', 'Photo optimization', 'Hours & services']
    },
    {
      icon: Link,
      title: 'Map Embed Stacking',
      description: 'Strategic placement of Google Maps embeds across high-authority websites',
      features: ['White-hat embedding', 'Tiered approach', 'IP-diverse strategy', 'Authority building']
    },
    {
      icon: Star,
      title: 'Review Generation',
      description: 'Proven systems to generate authentic, positive reviews from satisfied customers',
      features: ['Review request automation', 'Review monitoring', 'Response management', 'Review optimization']
    },
    {
      icon: TrendingUp,
      title: 'Link Building',
      description: 'Local citation building and high-quality backlink acquisition for domain authority',
      features: ['Local citations', 'NAP consistency', 'Industry backlinks', 'Authority domains']
    },
    {
      icon: FileText,
      title: 'Monthly Rankings Reporting',
      description: 'Comprehensive monthly reports showing your progress and local ranking improvements',
      features: ['Ranking tracking', 'Call volume analysis', 'Competitor monitoring', 'Performance insights']
    }
  ];

  return (
    <section className="py-20 bg-gray-50">
      <div className="container mx-auto px-4 sm:px-6 lg:px-8">
        {/* Section Header */}
        <motion.div 
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-bold text-primary-900 mb-6">
            What We Do
          </h2>
          <p className="text-xl text-gray-600 max-w-3xl mx-auto">
            Our proven local SEO strategies focus on Google Maps domination and real business growth
          </p>
        </motion.div>

        {/* Services Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8 max-w-7xl mx-auto">
          {services.map((service, index) => (
            <motion.div
              key={service.title}
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              viewport={{ once: true }}
              whileHover={{ y: -5 }}
              className="bg-white rounded-2xl p-8 shadow-lg hover:shadow-xl transition-all duration-300 border border-gray-100"
            >
              {/* Icon */}
              <div className="w-16 h-16 bg-gradient-to-br from-primary-500 to-primary-600 rounded-2xl flex items-center justify-center mb-6">
                <service.icon className="w-8 h-8 text-white" />
              </div>

              {/* Title */}
              <h3 className="text-2xl font-bold text-primary-900 mb-4">
                {service.title}
              </h3>

              {/* Description */}
              <p className="text-gray-600 mb-6 leading-relaxed">
                {service.description}
              </p>

              {/* Features */}
              <ul className="space-y-3">
                {service.features.map((feature, featureIndex) => (
                  <li key={featureIndex} className="flex items-center gap-3 text-gray-700">
                    <div className="w-2 h-2 bg-orange-500 rounded-full flex-shrink-0"></div>
                    <span className="text-sm">{feature}</span>
                  </li>
                ))}
              </ul>
            </motion.div>
          ))}
        </div>

        {/* CTA Section */}
        <motion.div 
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mt-16"
        >
          <div className="bg-gradient-to-r from-primary-900 to-primary-800 rounded-3xl p-8 md:p-12 text-white">
            <h3 className="text-3xl md:text-4xl font-bold mb-4">
              Ready to Dominate Your Local Market?
            </h3>
            <p className="text-xl text-gray-200 mb-8 max-w-2xl mx-auto">
              Join hundreds of local businesses already ranking in the Google Map Pack
            </p>
            <div className="flex flex-col sm:flex-row gap-4 justify-center">
              <button className="bg-orange-500 hover:bg-orange-600 text-white px-8 py-4 rounded-xl font-semibold text-lg transition-all duration-300 transform hover:scale-105">
                Book Free Strategy Call
              </button>
              <button className="bg-white/10 hover:bg-white/20 text-white px-8 py-4 rounded-xl font-semibold text-lg transition-all duration-300 border border-white/20">
                View Our Packages
              </button>
            </div>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Services;
